import React, { useState } from 'react';
import {
  Box,
  Paper,
  Typography,
  TextField,
  Button,
  Card,
  CardContent,
  Grid,
  Alert,
  CircularProgress,
  Divider,
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import XIcon from '../Icons/XIcon';

const AccountTracker = () => {
  const [username, setUsername] = useState('');
  const [trackingResult, setTrackingResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const startTracking = async () => {
    try {
      setLoading(true);
      const response = await fetch('/api/twitter/track', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ username: username.replace('@', '') }),
      });

      const data = await response.json();
      if (!data.success) {
        throw new Error(data.error || 'Failed to track account');
      }

      setTrackingResult(data.data);
      setUsername('');
    } catch (error) {
      console.error('Error:', error);
      setTrackingResult({ 
        error: error.message.includes('rate limit') 
          ? 'Twitter API rate limit reached. Please try again in a few minutes.'
          : error.message 
      });
    } finally {
      setLoading(false);
    }
  };

  return (
    <Paper 
      sx={{ 
        p: 3, 
        borderRadius: 2, 
        bgcolor: 'background.paper',
        minHeight: '150px',  // Reduced height
      }}
    >
      <Typography variant="h6" gutterBottom sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
        <XIcon color="primary" fontSize="small" />
        Track New Account
      </Typography>

      <Box sx={{ mt: 2 }}>
        <Grid container spacing={1} alignItems="center">
          <Grid item xs>
            <TextField
              fullWidth
              size="small"  // Smaller input
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              placeholder="Username"
              label="X Username"
              variant="outlined"
              InputProps={{
                startAdornment: <Box component="span" sx={{ color: 'text.secondary', mr: 1 }}>@</Box>,
              }}
            />
          </Grid>
          <Grid item>
            <Button
              variant="contained"
              size="small"  // Smaller button
              onClick={startTracking}
              disabled={loading || !username}
              startIcon={loading ? <CircularProgress size={16} /> : <AddIcon />}
            >
              {loading ? 'Adding...' : 'Add'}
            </Button>
          </Grid>
        </Grid>
      </Box>

      {trackingResult && (
        <Box sx={{ mt: 3 }}>
          {trackingResult.error ? (
            <Alert severity="error" sx={{ mb: 2 }}>
              {trackingResult.error}
            </Alert>
          ) : (
            <>
              <Alert severity="success" sx={{ mb: 3 }}>
                Now tracking: @{trackingResult.user?.username}
              </Alert>

              <Typography variant="h6" gutterBottom>
                Recent Tweets
              </Typography>

              <Grid container spacing={2}>
                {Array.isArray(trackingResult.tweets) ? (
                  trackingResult.tweets.map(tweet => (
                    <Grid item xs={12} key={tweet.id}>
                      <Card variant="outlined">
                        <CardContent>
                          <Typography variant="body1">
                            {tweet.text}
                          </Typography>
                          <Typography variant="caption" color="text.secondary" sx={{ mt: 1, display: 'block' }}>
                            {new Date(tweet.created_at).toLocaleString()}
                          </Typography>
                        </CardContent>
                      </Card>
                    </Grid>
                  ))
                ) : (
                  <Grid item xs={12}>
                    <Alert severity="info">No tweets found</Alert>
                  </Grid>
                )}
              </Grid>
            </>
          )}
        </Box>
      )}
    </Paper>
  );
};

export default AccountTracker;
